Scanned the 3 repositories mentioned on CONTRIB-9, no license violations found.

Before starting, we downloaded and unzipped (master branch) source code archives from GitHub.

*SDK*

{noformat}
cd sdk-master
npm install -g node-license-validator
npm install --prod
node-license-validator . --allow-licenses Apache, BSD-3-Clause, MIT
{noformat}

Result:

{noformat}
Identified licenses: Apache, BSD-3-Clause, MIT
All licenses ok.
{noformat}

*sdk-example-es6*

{noformat}
cd sdk-example-es6-master
{noformat}

Open `package.json` and replace `"greenkey-sdk": "git+ssh://git@github.com/greenkeytech/sdk.git",` with `"greenkey-sdk": "file:///Users/user/Downloads/sdk-master"` (replace the path with the FS location where you checked out the SDK)

{noformat}
npm install --prod
node-license-validator . --allow-licenses Apache-2.0
{noformat}

{noformat}
Identified licenses: Apache-2.0
All licenses ok.
{noformat}

*sdk-sample-vue*

{noformat}
cd sdk-example-vue-master
{noformat}

Open `package.json` and replace `"greenkey-sdk": "git+ssh://git@github.com/greenkeytech/sdk.git",` with `"greenkey-sdk": "file:///Users/user/Downloads/sdk-master"` (replace the path with the FS location where you checked out the SDK)

{noformat}
npm install --prod
node-license-validator . --allow-licenses Apache MIT
{noformat}

